// import { Outlet } from "react-router-dom";
import { Footer } from "./components/Footer";
import { Navs } from './components/startup/Navs';
import { StartupHome } from './compo/StartupHome';
import { Domain } from './components/startup/Domain';

const LayoutStartup = () => {
    return (
        <div className="App">
            <Navs />
            <StartupHome />
            <Domain />
            <Footer />
        </div>
    );
};

export default LayoutStartup;
